import React, { useState } from 'react';

const FoodSearch = () => {
    const [query, setQuery] = useState('');
    const [nutritionInfo, setNutritionInfo] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    const handleSearch = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError(null);
        try {
            const response = await fetch(`http://localhost:8080/api/api/food/search?query=${encodeURIComponent(query)}`);
            if (!response.ok) {
                throw new Error(`HTTP error! status: ${response.status}`);
            }
            const data = await response.json();
            console.log('API Response:', data);
            
            if (data.error) {
                setError(data.error);
                setNutritionInfo(null);
            } else {
                setNutritionInfo({
                    name: data.name,
                    protein: data.nutrition?.nutrients?.find(n => n.name === "Protein")?.amount || 0,
                    fat: data.nutrition?.nutrients?.find(n => n.name === "Fat")?.amount || 0,
                    carbs: data.nutrition?.nutrients?.find(n => n.name === "Carbohydrates")?.amount || 0,
                });
            }
        } catch (err) {
            console.error('Error:', err);
            setError('Failed to fetch nutrition information');
            setNutritionInfo(null);
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="max-w-md mx-auto mt-10 p-6 bg-white rounded-lg shadow-lg">
            <h1 className="text-2xl font-bold mb-6 text-center">Food Nutrition Search</h1>
            
            <form onSubmit={handleSearch} className="mb-6">
                <div className="flex gap-2">
                    <input
                        type="text"
                        value={query}
                        onChange={(e) => setQuery(e.target.value)}
                        placeholder="Enter a food item..."
                        className="flex-1 p-2 border rounded"
                        required
                    />
                    <button 
                        type="submit"
                        disabled={loading}
                        className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600 disabled:bg-green-300"
                    >
                        {loading ? 'Searching...' : 'Search'}
                    </button>
                </div>
            </form>

            {error && (
                <div className="text-red-500 text-center mb-4">{error}</div>
            )}

            {nutritionInfo && (
                <div className="bg-gray-50 p-4 rounded">
                    <h2 className="text-xl font-semibold mb-3">{nutritionInfo.name}</h2>
                    <div className="grid grid-cols-3 gap-4 text-center">
                        <div className="bg-blue-100 p-3 rounded">
                            <div className="font-bold text-lg">{nutritionInfo.protein.toFixed(1)}g</div>
                            <div className="text-sm">Protein</div>
                        </div>
                        <div className="bg-yellow-100 p-3 rounded">
                            <div className="font-bold text-lg">{nutritionInfo.fat.toFixed(1)}g</div>
                            <div className="text-sm">Fat</div>
                        </div>
                        <div className="bg-green-100 p-3 rounded">
                            <div className="font-bold text-lg">{nutritionInfo.carbs.toFixed(1)}g</div>
                            <div className="text-sm">Carbs</div>
                        </div>
                    </div>
                </div>
            )}
        </div>
    );
};

export default FoodSearch;
